script: |
  super -f text -I q11546.spq | sort > q11546.out

inputs:
  - name: q11546.spq
    data: |
      SELECT DISTINCT + 53 AS col0 FROM tab1 (FORMAT parquet) WHERE + ( + col2 ) NOT BETWEEN - col2 AND + CAST ( NULL AS INTEGER ) * + ( col0 ) * + - col2;
  - name: tab1

outputs:
  - name: q11546.out
    data: |
